class Fmp4JS extends Html5 {

  constructor(options, ready) {
    options = videojs.obj.merge(defaults, options);
    super(options, ready);
    this.TAG = "Fmp4JS";
    this.fmp4_src = null;
    this.fmp4_box = null;
    this.fmp4_is_ws = true;
    this.restart_timer = null;
    this.fmp4_websocket = null;
    this.fmp4_frame_queue = [];
    this.fmp4_source_buffer = null;
    this.fmp4_ws_first_frame = true;
    this._emitter = new EventEmitter();
    this.fmp4_media_source = new MediaSource();
    this.fmp4_http_controller = new AbortController();
    this.fmp4js_options = new Proxy({mime_codec: 'video/mp4; codecs="avc1.42E01E, mp4a.40.2"', live: false, is_hev: false}, {
        get(target, property, value) {
          return target[property]
        },
        set(target, property, value) {
          target[property] = value
          const _self = this.getCxt()
          if (property === 'live') _self.handlerLive()
          if (property === 'is_hev') {
            setTimeout(() => _self._emitter.emit("FMP4JS_HEVC", value), 200)
          }
          if (property === 'mime_codec') _self.fmp4MediaSourceOpen()
          return true
        },
        getCxt: () => this
      }
    )
  }

  setSrc(src) {
    this.fmp4_src = src
    this.fmp4_is_ws = this.fmp4_src.startsWith("ws")
    this.fmp4js_options.live = this.options_.config.live
    this.createFMP4Box();
    if (this.fmp4_is_ws) this.getWebSocketBuffer()
    else this.getHttpMp4Buffer()
  }

  dispose() {
    super.dispose();
    this.fmp4_websocket && this.fmp4_websocket.close()
    this._emitter = null;
    this.fmp4_src = null;
    this.fmp4_box = null;
    this.fmp4_is_ws = null;
    this.fmp4_websocket = null;
    this.fmp4_frame_queue = null;
    this.fmp4_media_source = null;
    this.fmp4_source_buffer = null;
    this.fmp4_ws_first_frame = null;
    this.fmp4_http_controller = null;

    this.restart_timer && clearTimeout(this.restart_timer)
    this.restart_timer = null;
  }

  getHttpMp4Buffer() {
    this.el_.src = this.fmp4_src
    let offset = 0
    fetch(this.fmp4_src, {signal: this.fmp4_http_controller.signal}).then(res => {
      const reader = res.body.getReader()
      reader.read().then(({value}) => {
        const buffer = value.buffer
        buffer.fileStart = offset
        offset += buffer.byteLength
        this.fmp4_box.appendBuffer(buffer)
      })
    })
  }

  createFMP4Box() {
    this.fmp4_box = new MP4Box.createFile()
    this.fmp4_box.onReady = (info) => {
      const {tracks, duration} = info
      let codecs = [];
      for (let i = 0; i < tracks.length; i++) codecs.push(tracks[i].codec);
      codecs.splice(2, codecs.length - 2)
      this.fmp4js_options.mime_codec = `video/mp4; codecs="${codecs.join(', ')}"`
      this.fmp4js_options.is_hev = !!codecs.find(code => code.includes('hvc1.'))
      console.warn(this.TAG, "MP4Box info", info)
      this.fmp4_http_controller.abort();
      this.fmp4_http_controller = null;
    }
  }

  getWebSocketBuffer() {
    this.fmp4_websocket = new WebSocket(this.fmp4_src);
    this.fmp4_websocket.binaryType = 'arraybuffer';
    this.fmp4_websocket.onmessage = (e) => {
      if (this.fmp4_ws_first_frame) {
        this.fmp4_ws_first_frame = false
        e.data.fileStart = 0
        this.fmp4_box.appendBuffer(e.data)
      }
      this.fmp4_frame_queue.push(e.data);
      if (!this.fmp4_source_buffer || this.fmp4_source_buffer.updating) return;
      if (this.fmp4_frame_queue.length === 1) this.fmp4_source_buffer.appendBuffer(this.fmp4_frame_queue.shift());
      else {
        let byte_length = 0;
        for (const frame of this.fmp4_frame_queue) byte_length += frame.byteLength;
        let mp4_frame_buffer = new Uint8Array(byte_length);
        let offset = 0;
        for (const frame of this.fmp4_frame_queue) {
          let frame_buffer = new Uint8Array(frame);
          mp4_frame_buffer.set(frame_buffer, offset);
          offset += frame.byteLength;
        }
        this.fmp4_source_buffer.appendBuffer(mp4_frame_buffer);
        this.fmp4_frame_queue.splice(0, this.fmp4_frame_queue.length);
      }

      this.restart_timer && clearTimeout(this.restart_timer)
      this.restart_timer = setTimeout(() => this._emitter.emit("FMP4JS_RESTART"), 1000 * 10)
    }

    this.fmp4_websocket.onclose = () => this._emitter.emit("FMP4JS_RESTART")

    this.fmp4_websocket.onerror = () => this._emitter.emit("FMP4JS_RESTART")

  }

  fmp4MediaSourceOpen() {
    if (!this.fmp4_is_ws) return
    else this.el_.src = URL.createObjectURL(this.fmp4_media_source)

    let pre_pos = 0;

    this.fmp4_media_source.addEventListener('sourceopen', () => {

      this.fmp4_source_buffer = this.fmp4_media_source.addSourceBuffer(this.fmp4js_options.mime_codec);

      this.fmp4_source_buffer.addEventListener('updateend', () => {
        let pos = this.el_.currentTime;
        if (this.el_.buffered.length > 0) {
          let start = this.el_.buffered.start(this.el_.buffered.length - 1);
          let end = this.el_.buffered.end(this.el_.buffered.length - 1);
          if (pos < start) this.el_.currentTime = start;
          if (pos > end) this.el_.currentTime = start;
          if (pos - pre_pos !== 0 && end - pos > 3) this.el_.currentTime = end;

          for (let i = 0; i < this.el_.buffered.length - 1; i++) {
            let pre_start = this.el_.buffered.start(i);
            let pre_end = this.el_.buffered.end(i);
            if (!this.fmp4_source_buffer.updating) this.fmp4_source_buffer.remove(pre_start, pre_end);
          }

          if (pos - start > 10 && !this.fmp4_source_buffer.updating) this.fmp4_source_buffer.remove(0, pos - 3);

          if (end - pos > 10 && !this.fmp4_source_buffer.updating) this.fmp4_source_buffer.remove(0, end - 3);
        }
        pre_pos = pos;
        if (!this.fmp4_source_buffer.updating) this.handlerLoading()
      })

    })
  }

  handlerLoading() {
    const loading_el = this.el_.parentNode.querySelector('.easy-player-loading')
    if (loading_el && loading_el.style.opacity === '1') return loading_el.style.opacity = "0"
  }

  handlerLive() {
    if (!this.fmp4js_options.live) return
    const vjs_playback_rate = this.el_.parentNode.querySelector(".vjs-playback-rate")
    const vjs_remaining_time = this.el_.parentNode.querySelector(".vjs-remaining-time")
    const vjs_progress_control = this.el_.parentNode.querySelector(".vjs-progress-control")
    if (vjs_playback_rate) vjs_playback_rate.style.opacity = "0";
    if (vjs_remaining_time) vjs_remaining_time.style.opacity = "0";
    if (vjs_progress_control) vjs_progress_control.style.opacity = "0";
  }


  play() {
    if (this.el_.paused) this.el_.play()
  }
}

Fmp4JS.VERSION = '1.0.0';
Fmp4JS.AUTHOR = 'Magic.XL';
videojs.registerTech('fmp4js', Fmp4JS);


const Component = videojs.getComponent("Component");

class Watermark extends Component {

  constructor(player, options) {
    super(player, options);
    if (options.watermark) this.updateTextContent(options.watermark);
  }

  createEl() {
    let parent_style = "position: absolute;background-color: rgba(0, 0, 0, 0.0);pointer-events: none;display: grid;";
    let grid_template_rows = "", grid_template_columns = "";
    if (!this.options_.watermark) return
    let {row = 4, col = 4, type = ""} = typeof this.options_.watermark === 'string' ? JSON.parse(this.options_.watermark) : this.options_.watermark
    const el = videojs.dom.createEl('div');
    if (type.toUpperCase() === 'FULL_SCREEN') {
      for (let i = 0; i < row; i++) grid_template_rows += "1fr "
      for (let k = 0; k < col; k++) grid_template_columns += "1fr "
      parent_style += `top:0;bottom:0;left:0;right:0;grid-template-rows:${grid_template_rows};grid-template-columns:${grid_template_columns};`
    } else {
      if (type.toUpperCase() === 'LEFT_TOP') parent_style += `top:0;left: 0;margin: 12px;`
      if (type.toUpperCase() === 'RIGHT_TOP') parent_style += `top:0;right: 0;margin: 12px;`
      if (type.toUpperCase() === 'LEFT_BOTTOM') parent_style += `bottom:0;left: 0;margin: 12px;`
      if (type.toUpperCase() === 'RIGHT_BOTTOM') parent_style += `bottom:0;right: 0;margin: 12px;`
    }
    el.setAttribute("style", parent_style)
    return el
  }

  buildCSSClass() {
    return '';
  }

  updateTextContent(watermark) {
    if (typeof watermark === 'string') watermark = JSON.parse(watermark)
    let {row = 4, col = 4, fontSize = 18, opacity = 0.6, color = "#FFF", rotate = -18, type = "", txt} = watermark
    if (!txt) return

    let custom_style = `display: flex;flex-direction: column;align-items: center;justify-content: center;font-family: "微软雅黑";
                          font-size: ${fontSize}px;opacity:${opacity};color:${color};`

    videojs.dom.emptyEl(this.el());
    if (type.toUpperCase() === 'FULL_SCREEN') custom_style += `transform:rotate(${rotate}deg)`
    else {
      row = col = 1;
      custom_style += `padding: 8px;background-color: rgba(0,0,0,0.6)`
    }
    for (let i = 0; i < row * col; i++) {
      const txt_el = document.createTextNode(txt);
      const watermark_item = document.createElement('div');
      watermark_item.appendChild(txt_el)
      watermark_item.setAttribute('class', 'easy-watermark-item')
      watermark_item.setAttribute('style', custom_style)
      this.el().appendChild(watermark_item)
    }

  }
}

Watermark.VERSION = '1.0.0';
Watermark.AUTHOR = 'Magic.XL';
Component.registerComponent('watermark', Watermark);



